INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('page', 0, 1, 1, 'und', 0, 'Thank you for taking the time out of your busy day to explore the Two Trees Olive Oil website. We hope you''ll find the information on these pages both educational and inspiring. You''ll find an interactive tour to learn about our oil-making process, and can shop for all our delicious products right here online, or find stores that carry them. We love to get feedback about our products, website, and company in general so please feel free to leave us a message at feedback@twotreesoliveoil.com.', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('page', 0, 2, 2, 'und', 0, 'In 1903, my great grandparents came to the United States from Italy. Not only did they bring their recipes for traditional home-style Italian cooking, but they also brought their knowledge of raising olives for the creation of fine olive oil. Over several decades, they perfected the process that now lies at the heart of Two Trees Extra Virgin Olive Oil. Over 100 years later, I''m very proud to have passed this tradition onto my children and grandchildren, and to continue offering my grandparents'' wonderful olive oil to the world.\r\n\r\nWith the advent of modern machinery and improved organic farming techniques, Two Trees Olive Oil has continued to raise the bar in extra virgin olive oil production - winning awards year after year for flavor, quality, innovation, and environmental consciousness. Not to mention, we consider our 3,000 employees worldwide to be part of a large, extended family, and have consistently improved working conditions and benefits, to ensure their happiness and job satisfaction. We feel fortunate to be able to put 5 percent of the total sales from our olive oil back into employee development programs such as continued education. In addition, another 5 percent of our olive oil sales goes directly to charitable social, environmental, animal welfare, and human rights causes.', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('page', 0, 2, 4, 'und', 0, 'In 1903, my great grandparents came to the United States from Italy. Not only did they bring their recipes for traditional home-style Italian cooking, but they also brought their knowledge of raising olives for the creation of fine olive oil. Over several decades, they perfected the process that now lies at the heart of Two Trees Extra Virgin Olive Oil. Over 100 years later, I''m very proud to have passed this tradition onto my children and grandchildren, and to continue offering my grandparents'' wonderful olive oil to the world.\r\n\r\nWith the advent of modern machinery and improved organic farming techniques, Two Trees Olive Oil has continued to raise the bar in extra virgin olive oil production - winning awards year after year for flavor, quality, innovation, and environmental consciousness. Not to mention, we consider our 3,000 employees worldwide to be part of a large, extended family, and have consistently improved working conditions and benefits, to ensure their happiness and job satisfaction. We feel fortunate to be able to put 5 percent of the total sales from our olive oil back into employee development programs such as continued education. In addition, another 5 percent of our olive oil sales goes directly to charitable social, environmental, animal welfare, and human rights causes.\r\n\r\nOur goal for the future is to continue to expand our oil varieties, while adding other delicious and inspired products to our recently developed and wildly successful bread and cracker line. In addition, we constantly strive to be the kind of company my grandparents would expect us to be, by giving back to our families, our people, and the world, because at the end of the day, these are the things that matter most.\r\n\r\nThank you for your interest in Two Trees Olive Oil. We hope you enjoy our products and invite you to send us your comments and suggestions by email to feedback@twotreesoliveoil.com.\r\n\r\nSincerely,\r\n\r\nMaria Ann Vitalia & the Entire Vitalia family ', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('page', 0, 2, 5, 'und', 0, 'In 1903, my great grandparents came to the United States from Italy. Not only did they bring their recipes for traditional home-style Italian cooking, but they also brought their knowledge of raising olives for the creation of fine olive oil. Over several decades, they perfected the process that now lies at the heart of Two Trees Extra Virgin Olive Oil. Over 100 years later, I''m very proud to have passed this tradition onto my children and grandchildren, and to continue offering my grandparents'' wonderful olive oil to the world.\r\n\r\nWith the advent of modern machinery and improved organic farming techniques, Two Trees Olive Oil has continued to raise the bar in extra virgin olive oil production - winning awards year after year for flavor, quality, innovation, and environmental consciousness. Not to mention, we consider our 3,000 employees worldwide to be part of a large, extended family, and have consistently improved working conditions and benefits, to ensure their happiness and job satisfaction. We feel fortunate to be able to put 5 percent of the total sales from our olive oil back into employee development programs such as continued education. In addition, another 5 percent of our olive oil sales goes directly to charitable social, environmental, animal welfare, and human rights causes.\r\n\r\nOur goal for the future is to continue to expand our oil varieties, while adding other delicious and inspired products to our recently developed and wildly successful bread and cracker line. In addition, we constantly strive to be the kind of company my grandparents would expect us to be, by giving back to our families, our people, and the world, because at the end of the day, these are the things that matter most.\r\n\r\nThank you for your interest in Two Trees Olive Oil. We hope you enjoy our products and invite you to send us your comments and suggestions by email to feedback@twotreesoliveoil.com.\r\n\r\nSincerely,\r\n\r\n<a href="/contact">Maria Ann Vitalia & the Entire Vitalia family</a>', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('page', 0, 2, 6, 'und', 0, 'In 1903, my great grandparents came to the United States from Italy. Not only did they bring their recipes for traditional home-style Italian cooking, but they also brought their knowledge of raising olives for the creation of fine olive oil. Over several decades, they perfected the process that now lies at the heart of Two Trees Extra Virgin Olive Oil. Over 100 years later, I''m very proud to have passed this tradition onto my children and grandchildren, and to continue offering my grandparents'' wonderful olive oil to the world.\r\n\r\nWith the advent of modern machinery and improved organic farming techniques, Two Trees Olive Oil has continued to raise the bar in extra virgin olive oil production - winning awards year after year for flavor, quality, innovation, and environmental consciousness. Not to mention, we consider our 3,000 employees worldwide to be part of a large, extended family, and have consistently improved working conditions and benefits, to ensure their happiness and job satisfaction. We feel fortunate to be able to put 5 percent of the total sales from our olive oil back into employee development programs such as continued education. In addition, another 5 percent of our olive oil sales goes directly to charitable social, environmental, animal welfare, and human rights causes.\r\n\r\nOur goal for the future is to continue to expand our oil varieties, while adding other delicious and inspired products to our recently developed and wildly successful bread and cracker line. In addition, we constantly strive to be the kind of company my grandparents would expect us to be, by giving back to our families, our people, and the world, because at the end of the day, these are the things that matter most.\r\n\r\nThank you for your interest in Two Trees Olive Oil. We hope you enjoy our products and invite you to send us your comments and suggestions by email to feedback@twotreesoliveoil.com.\r\n\r\nSincerely,\r\n\r\nMaria Ann Vitalia & the Entire Vitalia family ', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('article', 0, 3, 3, 'und', 0, 'The Northern New England Organic Chefs Association (NNEOCA) recently endorsed Two Trees Olive Oil as their preferred brand of choice. NNEOCA spent months testing a variety of extra virgin olive oils at their member chef''s restaurant. Two Trees Olive Oil was the preferred brand by nearly all of the chefs.\r\n\r\n"TTOO has a superior flavor for dipping bread, as well as using it in our vegetable sautees," said Mary Greene, chef/owner of Vermont Secret Garden restaurant in downtown Brattleboro. "We''ll be using it exclusively in our restaurant going forward."', 'Yet another chef''s association votes in our products as their preferred brand of choice.', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('article', 0, 4, 7, 'und', 0, 'Nino and Ann Vitalia make the long journey from Naples Italy to upstate New York with their daughter and two sons to begin growing apples and olives on a newly purchased 25-acre farm.\r\n', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('article', 0, 5, 8, 'und', 0, 'Nino and Ann create a small olive press in their basement and begin to make olive oil as a hobby for their family, friends, and neighbors.\r\n', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('article', 0, 6, 9, 'und', 0, 'The Vitalias'' olive oil wins Grand Prize at the New York State Fair. An investor approaches Nino and Ann with an offer to mass produce their olive oil.\r\n', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('article', 0, 7, 10, 'und', 0, 'The Vitalias begin larger scale production of their unique olive oil in a small factory in Brooklyn. They produce 10,000 bottles of olive oil the first year.', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('article', 0, 8, 11, 'und', 0, 'The Vitalias halt production of all olive oil production in the factory, as the Great Depression takes hold. They continue to create olive oil in their basement, experimenting with flavor variations.', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('article', 0, 9, 12, 'und', 0, 'As the economy slowly starts to repair, Nino and Ann use their remaining savings to open up a larger scale factory in Brooklyn. They begin to produce three versions of their olive oil: Regular, Garlic, and Lemon.', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('article', 0, 10, 13, 'und', 0, 'The Vitalias are provided the opportunity to be the sole olive oil producer for a national chain of restaurants. For the next fifty years the Vitalias and their children continue to produce their award-winning oils for national restaurant chains.', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('article', 0, 11, 14, 'und', 0, 'The Vitalias'' great-granddaughter, Maria Ann Vitalia inherits the olive oil company and the Two Trees brand is born. Maria and her family work hard over the next 15 years to make Two Trees Olive Oil one of the top olive oils in gross sales in the nation and to create a company that gives back to its employees and various philanthropic causes. And the tradition continues today.', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('blog', 0, 14, 21, 'und', 0, 'I liked to use the basil-flavored olive oil for salads -- no surprise there. But then when I was crushing basic for pesto, it dawned on me: Why not use a mixture of green herbs with the basil olive oil? I tried it, and it''s great!\r\n\r\nI recommend adding a bit of mint and cilantro to a base of basil. Any other ideas?', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('blog', 0, 15, 22, 'und', 0, 'Strangely, TTOO''s garlic olive oil didn''t do much for me -- probably because I was already using so much garlic, I couldn''t tell the difference. Soo-eee!', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('blog', 0, 16, 23, 'und', 0, 'So -- we have garlic, lemon, and basil olive oil already. What comes next?\r\n\r\nWe''ll take your suggestions here, then post a poll soon so you can vote on them.', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('blog', 0, 17, 24, 'und', 0, 'I know, I know... I''m late to the party. But I just started using Two Trees Olive Oil as a moisturizer, and I''m thrilled with how it feels! A few things to know:\r\n\r\n1) It''s going to feel a bit more "oily" than a lot of moisturizers. But hey -- It''s <i>oil</i>. So just give it a bit more time to soak in.\r\n\r\n2) You don''t need much!\r\n\r\n3) Make sure you''re using fresh olive oil: While cooking will mask a smack of rancidity, you really don''t want that on your skin.\r\n\r\nEnjoy!', '', 'filtered_html', 'node');
INSERT INTO `field_revision_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`, `entity_type`) VALUES('forum', 0, 18, 25, 'und', 0, 'I''ve heard all sorts of claims. What do you think?', '', 'filtered_html', 'node');
INSERT INTO `field_revision_comment_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`, `entity_type`) VALUES('comment_node_article', 0, 1, 1, 'und', 0, 'It was also the year I got married... on Two Trees'' property. :) It was beautiful!', 'filtered_html', 'comment');
INSERT INTO `field_revision_comment_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`, `entity_type`) VALUES('comment_node_article', 0, 2, 2, 'und', 0, 'Wow, that''s great! How did you swing that?', 'filtered_html', 'comment');
INSERT INTO `field_revision_comment_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`, `entity_type`) VALUES('comment_node_article', 0, 5, 5, 'und', 0, 'My family''s been friends with the Vitalias for years. I don''t think they let just anybody use the property, but maybe I''m wrong.', 'filtered_html', 'comment');
INSERT INTO `field_revision_comment_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`, `entity_type`) VALUES('comment_node_article', 0, 6, 6, 'und', 0, 'Hi, Polly! Love the username :) . We''ve been talking about making the property available for weddings and such, but haven''t worked out the details. (Also, I think we''d need to upgrade our facilities a bit.) But watch this web site! If it happens, we''ll post about it here. Thanks for the interest! --Maria Ann Vitalia', 'filtered_html', 'comment');
INSERT INTO `field_revision_comment_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`, `entity_type`) VALUES('comment_node_article', 0, 7, 7, 'und', 0, 'It was indeed a very good year. :)', 'filtered_html', 'comment');
INSERT INTO `field_revision_comment_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`, `entity_type`) VALUES('comment_node_article', 0, 8, 8, 'und', 0, 'Yes, it was a great year!', 'filtered_html', 'comment');
INSERT INTO `field_revision_comment_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`, `entity_type`) VALUES('comment_node_forum', 0, 10, 10, 'und', 0, 'but remember, it''s a fat and should be treated as one.', 'filtered_html', 'comment');
INSERT INTO `field_revision_comment_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`, `entity_type`) VALUES('comment_node_blog', 0, 11, 11, 'und', 0, 'Some kind of fruit -- maybe cherry or blueberry?', 'filtered_html', 'comment');
INSERT INTO `field_revision_comment_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`, `entity_type`) VALUES('comment_node_blog', 0, 12, 12, 'und', 0, 'I like the basil, but wish it was a more complex flavor. How about a mixture, like basil/rosemary/mint? I''m sure your experts will figure out the right balance. :)', 'filtered_html', 'comment');
INSERT INTO `field_revision_comment_body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`, `entity_type`) VALUES('comment_node_blog', 0, 13, 13, 'und', 0, 'Maybe a "hot oil" like you get in pots at some Chinese restaurants... red pepper, cayenne, something like that.', 'filtered_html', 'comment');
