INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES(1, 'node', ' two trees extra virgin olive oil in a store near you  thank you for taking the time out of your busy day to explore the two trees olive oil website we hope you ll find the information on these pages both educational and inspiring you ll find an interactive tour to learn about our oilmaking process and can shop for all our delicious products right here online or find stores that carry them we love to get feedback about our products website and company in general so please feel free to leave us a message at feedback twotreesoliveoilcom   ', 0);
INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES(2, 'node', ' the story behind two trees extra virgin olive oil in 1903 my great grandparents came to the united states from italy not only did they bring their recipes for traditional homestyle italian cooking but they also brought their knowledge of raising olives for the creation of fine olive oil over several decades they perfected the process that now lies at the heart of two trees extra virgin olive oil over 100 years later i m very proud to have passed this tradition onto my children and grandchildren and to continue offering my grandparents wonderful olive oil to the world with the advent of modern machinery and improved organic farming techniques two trees olive oil has continued to raise the bar in extra virgin olive oil production winning awards year after year for flavor quality innovation and environmental consciousness not to mention we consider our 3000 employees worldwide to be part of a large extended family and have consistently improved working conditions and benefits to ensure their happiness and job satisfaction we feel fortunate to be able to put 5 percent of the total sales from our olive oil back into employee development programs such as continued education in addition another 5 percent of our olive oil sales goes directly to charitable social environmental animal welfare and human rights causes our goal for the future is to continue to expand our oil varieties while adding other delicious and inspired products to our recently developed and wildly successful bread and cracker line in addition we constantly strive to be the kind of company my grandparents would expect us to be by giving back to our families our people and the world because at the end of the day these are the things that matter most thank you for your interest in two trees olive oil we hope you enjoy our products and invite you to send us your comments and suggestions by email to feedback twotreesoliveoilcom  sincerely maria ann vitalia the entire vitalia family  ', 0);
INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES(3, 'node', ' two trees olive oil adopted by northern new england organic chefs association the northern new england organic chefs association nneoca recently endorsed two trees olive oil as their preferred brand of choice nneoca spent months testing a variety of extra virgin olive oils at their member chef s restaurant two trees olive oil was the preferred brand by nearly all of the chefs ttoo has a superior flavor for dipping bread as well as using it in our vegetable sautees said mary greene chef owner of vermont secret garden restaurant in downtown brattleboro we ll be using it exclusively in our restaurant going forward  press release pr neoca news ', 0);
INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES(4, 'node', ' 1903 coming to america nino and ann vitalia make the long journey from naples italy to upstate new york with their daughter and two sons to begin growing apples and olives on a newly purchased 25acre farm timeline historical ', 0);
INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES(5, 'node', ' 1908 olive oil hobbyists nino and ann create a small olive press in their basement and begin to make olive oil as a hobby for their family friends and neighbors timeline historical ', 0);
INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES(6, 'node', ' 1910 first awards and recognition the vitalias olive oil wins grand prize at the new york state fair an investor approaches nino and ann with an offer to mass produce their olive oil timeline historical ', 0);
INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES(7, 'node', ' 1911 new york city expansion the vitalias begin larger scale production of their unique olive oil in a small factory in brooklyn they produce 10000 bottles of olive oil the first year timeline historical ', 0);
INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES(8, 'node', ' 1929 pulling inward during the great depression the vitalias halt production of all olive oil production in the factory as the great depression takes hold they continue to create olive oil in their basement experimenting with flavor variations timeline historical ', 0);
INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES(9, 'node', ' 1936 rebirth and flavored olive oils as the economy slowly starts to repair nino and ann use their remaining savings to open up a larger scale factory in brooklyn they begin to produce three versions of their olive oil regular garlic and lemon timeline historical ', 0);
INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES(10, 'node', ' 1945 major commercial debut the vitalias are provided the opportunity to be the sole olive oil producer for a national chain of restaurants for the next fifty years the vitalias and their children continue to produce their awardwinning oils for national restaurant chains timeline postwar historical ', 0);
INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES(11, 'node', ' 1995 passing on the tradition the vitalias greatgranddaughter maria ann vitalia inherits the olive oil company and the two trees brand is born maria and her family work hard over the next 15 years to make two trees olive oil one of the top olive oils in gross sales in the nation and to create a company that gives back to its employees and various philanthropic causes and the tradition continues today timeline postwar historical joebob mon 12062010 1150 permalink 1995 was a great year  it was also the year i got married on two trees property it was beautiful  log in or register to post comments polly ann saturated mon 12062010 1152 permalink really  wow that s great how did you swing that  log in or register to post comments joebob mon 12062010 1154 permalink i think you have to know them  my family s been friends with the vitalias for years i don t think they let just anybody use the property but maybe i m wrong log in or register to post comments maria ann vitalia mon 12062010 1156 permalink we re thinking of opening up the place hi polly love the username we ve been talking about making the property available for weddings and such but haven t worked out the details also i think we d need to upgrade our facilities a bit but watch this web site if it happens we ll post about it here thanks for the interest maria ann vitalia log in or register to post comments oilexplorer mon 12062010 1156 permalink i also got married in 1995  it was indeed a very good year  log in or register to post comments  ', 1291671718);
